import React, { Component } from 'react'

export default class Slide2 extends Component {
    render() {
        return (
            <div className="bg-image ripple" data-mdb-ripple-color="light">
                <img src="img/sell-btn.jpg" class="w-100" />
                <a href="#startnow">
                    <div
                        class="mask">
                        <div class="d-flex justify-content-center align-items-center h-100">
                            <h1 class="text-white mb-0">SELL</h1>
                            <h2 class="text-white mb-0">FAST</h2>
                        </div>
                    </div>
                    <div class="hover-overlay">
                        <div
                            class="mask"
                            
                            style={{}}
                            // style="background: linear-gradient(
                            // 45deg,
                            // rgba(29, 236, 197, 0.5),
                            // rgba(91, 14, 214, 0.5) 100%
                            // );"
                            >
                            <div class="d-flex justify-content-center align-items-center h-100">
                                <h1 class="text-white mb-0">SELL</h1>
                                <h2 class="text-white mb-0">FAST</h2>
                            </div>
                        </div>
                    </div>
                </a>
            </div>
        )
    }
}
